javascript:(function(){const elements=document.querySelectorAll("input, select, textarea");const results={valid:[],invalid:[],missing:[]};const style=document.createElement("style");style.textContent=`\n            .ac-panel {\n              position:fixed;\n              top:10px;\n              left:10px;\n              background:#fff;\n              padding:15px;\n              border-radius:5px;\n              box-shadow:0 0 10px rgba(0,0,0,.2);\n              z-index:99999;\n              max-width:300px;\n              font-family:-apple-system,system-ui,sans-serif\n            }\n            #ac-panel-title {\n              font-size:1.5em\n            }\n            .ac-stats {\n              margin:10px 0;\n              padding:10px;\n              background:#f5f5f5;\n              border-radius:3px\n            }\n            .ac-indicator {\n              background-color:#ff0;\n              color:#000;\n              display:block;\n              max-inline-size:fit-content;\n              padding:2px 5px;\n              margin-top:2px;\n              border-radius:3px;\n              font-size:15px;\n              font-family:monospace;\n              font-weight:bold;\n              transition:.2s;\n            }\n            .ac-valid {\n              background-color:#cfc;\n            }\n            .ac-invalid {\n              background-color:#fcc;\n            }\n            .ac-missing {\n              background-color:#ffc\n            }\n            .ac-hidden {\n              display:none\n            }\n            .ac-btn {\n              margin:5px;\n              padding:5px 10px;\n              border:none;\n              border-radius:3px;\n              background:#2196F3;\n              color:#fff;\n              cursor:pointer\n            }\n          `;document.head.appendChild(style);const allowedValues=["on","off","name","given-name","additional-name","family-name","email","tel","url","street-address","address-line1","address-line2","address-line3","address-level1","address-level2","address-level3","address-level4","country","country-name","postal-code","cc-name","cc-given-name","cc-additional-name","cc-family-name","cc-number","cc-exp","cc-exp-month","cc-exp-year","cc-csc","cc-type","transaction-currency","transaction-amount","bday","bday-day","bday-month","bday-year","sex","gender","organization","organization-title","language","username","new-password","current-password","one-time-code","tel-country-code","tel-national","tel-area-code","tel-local","tel-extension","impp","photo","shipping-name","shipping-given-name","shipping-family-name","shipping-street-address","shipping-postal-code","shipping-country","billing-name","billing-given-name","billing-family-name","billing-street-address","billing-postal-code","billing-country","home-email","work-email","mobile-tel","home-tel","work-tel","fax-tel","pager-tel"];elements.forEach((function(element){if(element.hasAttribute("autocomplete")){allowedValues.includes(element.getAttribute("autocomplete"))?results.valid.push(element):results.invalid.push(element)}else{results.missing.push(element)}}));const panel=document.createElement("div");panel.className="ac-panel";panel.setAttribute("role","region");panel.setAttribute("aria-labelledby","ac-panel-title");panel.innerHTML=`\n             <p id="ac-panel-title">detectAutocomplete</p>\n              <div class="ac-stats">\n                Total: ${elements.length}<br>\n                Valid: ${results.valid.length}<br>\n                Invalid: ${results.invalid.length}<br>\n                Missing: ${results.missing.length}\n              </div>\n              <button class="ac-btn" id="ac-toggle">Hide/Display</button>\n            `;document.body.appendChild(panel);elements.forEach((function(element){const label=document.createElement("p");label.className="ac-indicator";if(element.hasAttribute("autocomplete")){const value=element.getAttribute("autocomplete");const isValid=allowedValues.includes(value);const validStatus=isValid?'<span role="status">Valid</span>':'<span role="alert">Invalid</span>';label.innerHTML=`autocomplete="${value}" ${validStatus}`;label.className+=isValid?" ac-valid":" ac-invalid"}else{label.className+=" ac-missing";label.textContent="autocomplete missing"}element.parentNode.insertBefore(label,element.nextSibling)}));document.getElementById("ac-toggle")?.addEventListener("click",(()=>{document.querySelectorAll(".ac-indicator").forEach((el=>el.classList.toggle("ac-hidden")))}))})();